drop schema PPO cascade;
create schema PPO;

--drop table PPO.Users cascade;
--drop table PPO.Canvas cascade;
--drop table PPO.Params cascade;

--Создание таблиц
create table if not exists PPO.Users
(
	id serial primary key,
	login text,
	password text,
	role text,
	moderator_id int,
	FOREIGN KEY (moderator_id) REFERENCES PPO.Users (id)
);

alter table PPO.Users ADD constraint unique_login unique (login);

create table if not exists PPO.Canvas
(
	id serial primary key,
	user_id int,
	FOREIGN KEY (user_id) REFERENCES PPO.Users (id),
	name text unique,
	HeightsMap text,
	TriPolArray text,
	--Params text,
	Color text
);

--Заполнение таблиц тестовыми данными
insert into PPO.Users (login, password, role, moderator_id)
				values('user1', '123', 'canvas_user', NULL);
insert into PPO.Users (login, password, role, moderator_id)
				values('user2', '123', 'canvas_user', NULL);
insert into PPO.Users (login, password, role, moderator_id)
				values('moderator1', '123', 'moderator', NULL);
insert into PPO.Users (login, password, role, moderator_id)
				values('user3', '123', 'canvas_user', 3);
			
